import React from 'react';
var CellEditorValidationMessage = function (props) {
    var message = props.message;
    return (React.createElement("div", { className: 'ka-validation-message-container' },
        React.createElement("div", { className: 'ka-validation-message' }, message)));
};
export default CellEditorValidationMessage;
